import React from 'react'
import Nav from 'react-bootstrap/Nav'

class NavSize extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <Nav defaultActiveKey="All">
                <Nav.Item>
                    <Nav.Link eventKey="All" onSelect={this.props.onSelectFilterSize}>All</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link eventKey="Meat" onSelect={this.onSelectFilterSize}>Meat</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link eventKey="Veggie" onSelect={this.onSelectFilterSize}>Veggie</Nav.Link>
                </Nav.Item>
            </Nav>
        )
    }
}

export default NavSize
